import React from "react";
import { compose } from "recompose";
import { makeStyles } from "@material-ui/core/styles";
import styled from "styled-components";
import { useRouter } from "next/router";
import { Avatar, Drawer } from "@material-ui/core";
import WithLayout from "../../../components/Landlrd/Layout";
import { theme as customTheme } from "../../../components/Page";
import {
  Container,
  CaptionText,
  SubText,
  Header
} from "../../../components/styledComponents";

import SingleHouse from "../../../components/Landlrd/SingleHouse";

const House = props => {
  return (
    <Container flex={1}>
      <SingleHouse {...props} />
    </Container>
  );
};

export default WithLayout(House);
